SELECT partsupp.ps_comment, MIN(partsupp.ps_partkey) AS min_partsupp_ps_partkey, MAX(partsupp.ps_suppkey) AS max_partsupp_ps_suppkey FROM partsupp WHERE partsupp.ps_suppkey BETWEEN 115 AND 969 AND partsupp.ps_partkey BETWEEN 29 AND 566 AND partsupp.ps_comment LIKE 'A%' GROUP BY partsupp.ps_comment HAVING COUNT(*) > 9735 AND MAX(partsupp.ps_suppkey) > 33040 ORDER BY partsupp.ps_comment